import React from 'react';
import { KnightWhite,  Destination, Knight } from './Icon';
import './Board.scss';



class Board extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          boardSize: 8,
          boardElements: []
        }
    }

    componentDidMount() {
      this.init();
    }

    init = () => {
      this.setState({
        boardElements: [0,1,2,3,4,5,6,7]
      })
    }

    render() {
        const { boardElements } = this.state;
        const { Knight, Destination } = this.props;
        console.log(Knight, Destination);
        return (
          <ul>
            {boardElements.map(index => 
              <li key={index}>
                <ul>
                  {boardElements.map(childIndex => 
                    <li key={`${index}-${childIndex}`}></li>
                  )}
                </ul>
              </li>
            )}
          </ul>
        ) 
    }
}

export default Board;
